import styled from 'styled-components'

export const DetailApp = styled.section`
    .home-top-third {
        float: left;
        width: 392px;
    }

    .chance-button {
        float: left;
        width: 100%;
        position: relative;
    }

    .chance-button img {
        width: 100%;
    }

    .chance-button-balloon {
        width: 220px;
        position: absolute;
        top: -80px;
        right: 0;
    }

    .chance-button-balloon img {
        float: left;
        width: 46px;
        height: 48px;
        margin-top: 25px;
        margin-right: 15px;
        object-fit: contain;
    }

    .chance-button-balloon p {
        font-family: SFProText;
        font-size: 14px;
        font-weight: normal;
        font-style: italic;
        font-stretch: normal;
        line-height: normal;
        letter-spacing: normal;
        color: #f4511e;
    }

    .chance-people {
        float: left;
        width: 100%;
        display: flex;
        align-items: center;
    }

    .chance-people-numbers {
        float: left;
    }

    .chance-people-numbers span {
        float: left;
        min-width: 24px;
        height: 24px;
        margin-left: -7px;
        border-radius: 50px;
        border: solid 2px #ffffff;
        background: rgba(0, 0, 0, 0.16);
    }

    .chance-people-numbers span:first-of-type {
        margin-left: 0;
    }

    .chance-people-numbers span.people-total {
        padding: 0 10px;
        line-height: 22px;
        font-family: SFProText;
        font-size: 14px;
        font-weight: normal;
        font-style: normal;
        font-stretch: normal;
        letter-spacing: normal;
        text-align: center;
        color: rgba(0, 0, 0, 0.6);
    }

    .chance-people-text {
        float: left;
        margin-left: 15px; 
    }

    .chance-people-text p {
        float: left;
        font-family: SFProText;
        font-size: 14px;
        font-weight: normal;
        font-style: normal;
        font-stretch: normal;
        line-height: 1.5;
        letter-spacing: normal;
        color: rgba(0, 0, 0, 0.6);
    }
`;
